import React, { useState } from 'react';
import genId from '../utils/genId';
import apiccHelper from '../helpers/apicc';

const Setup = () => {
  const [toHash, setToHash] = useState("");
  const [result, setResult] = useState("");
  const [waiting, setWaiting] = useState(true);

  const init = async () => {
    setWaiting(true);
    const msg = await apiccHelper.setup();
    console.log(msg);
    alert(msg);
  }
  return (
      <div class="container">
        <div class="row">
          <div class="col-6">
            <div class= "col-2 offset-1">
              <button name="submit" type="submit" class="btn btn-primary" onClick={init}>Enviar</button>
            </div>
            <div class="col-7">
              <div class="d-flex align-items-center">
                <strong>Inicializando el Proceso</strong>
                <div class="spinner-border ml-auto" role="status" aria-hidden="true"></div>
              </div>
            </div>
           </div>
          <div class="col-6">
          </div>
        </div>
      </div>
  )
};
export default Setup;
